A real life example of unpacking fatphobia👆🏽

*Disclaimer: I’m using the word ‘fat’ in this video as a neutral descriptor just as I would say the word thin or tall.

Going up to someone who has full body autonomy and telling them what they need to do with the size of their body is 1,000% weight stigma 🚩

We are raised in a society where we’re told that people in larger bodies are lazy, bad, and unhealthy, which leads to these individuals being oppressed, shamed, and stigmatized.

And we know from research that weight stigma alone has terrible negative health effects on a person, especially when someone has been stigmatized for the majority of their life.😣

It takes a lot of courage to acknowledge that you’ve caused harm and need help unpacking your own weight stigma and fatphobia.

Yes, this work is uncomfortable and challenging, BUT it’s absolutely necessary❗

